package com.jsp.studyShare.model;import java.util.Date;public class Token {    private int tid;    private String openid;    private Date expired;    private int status;    private String tokens;    public int getTid() {        return tid;    }    public void setTid(int tid) {        this.tid = tid;    }    public String getOpenid() {        return openid;    }    public void setOpenid(String openid) {        this.openid = openid;    }    public Date getExpired() {        return expired;    }    public void setExpired(Date expired) {        this.expired = expired;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }    public String getTokens() {        return tokens;    }    public void setTokens(String tokens) {        this.tokens = tokens;    }}